import axios from "axios";

const Kinds = () => {
  const [kinds, setKinds] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:4000/kinds")
      .then((res) => {
        console.log("Kinds res: ", res);
      })
      .catch((err) => {
        console.log(err);
      });
  });

  return (
    <div>
      <h2>Kinds of Arguments</h2>
      {/* {kinds.map(kind => {

      })} */}
    </div>
  );
};

export default Kinds;
